Kami bergerak atas dasar kesamaan visi dan misi untuk kota tercinta Tasikmalaya.
Ide dan gerakan-gerakan kami dipertemukan di beberapa kedai kopi. 
Awalnya sekedar silaturahmi yang ditemani kopi, kemudian semakin serius untuk berkolaborasi bersama membuat acara di salah satu ikon Tasikmalaya yaitu Gunung Galunggung.

Kopi, Adventure, Musik, Literasi, Foto dan Film akan kami persembahkan bersama-sama di Gunung Galunggung.

Be there on 16 and 17 September 2017 
